import './../Style/History.css';
import { useState, useEffect } from "react";
import {variables} from "../Variables";
import React from 'react';

function AppHistory(){
    const [order, setOrder] = useState([]);

    useEffect(() => {
        fetch(variables.API_URL+"get_order_user/"+localStorage.getItem("id"), {
            method: "GET",
            headers: {
                'Accept': 'application/json, text/plain',
                'Content-Type': 'application/json;charset=UTF-8'
            },
            })
            .then(response => response.json())
            .then(result => {
                console.log(result)
                setOrder(result)
            }
        )
    }, []);

    if(order.length > 0){
        async function renderTableData() {
            return order.map((item, index) => {
               const { id, create_date, status } = item //destructuring
               return (
                  <tr key={index}>
                     <td>{id}</td>
                     <td>{create_date}</td>
                     <td>{status}</td>
                     <td>-</td>
                  </tr>
               )
            })
         }

        console.log(order)

        return(
        <div className="history">
            <h1>User Service History</h1>
            <div className='history-table'>
                <table>
                        <tr>
                            <th>Deatils</th>
                            <th>Date Time</th>
                            <th>Status</th>
                            <th>To Review</th>
                        </tr>
                        {renderTableData}
                </table>
            </div>
        </div>
        );
    }
}

export default AppHistory;
